import React from "react";
import NavBar from "./components/Navbar";
import LoginBox from "./components/LoginBox";

export default function LoginPage() {
  return (
    <div>
      <NavBar />

      <Grid
        container
        justifyContent={"center"}
        spacing={"20em"}
        sx={{
          padding: "10em 5em",
        }}
      >
        <Grid item width={"45%"}>
          <Typography variant="h2" color={"#ffffff"}>
            Check out our <span style={{color:"#308335", fontWeight:"500"}}>NEW</span> crop recognition software
          </Typography>
        </Grid>
        <Grid item width={"45%"}>
          <LoginBox />
        </Grid>
      </Grid>
    </div>
  );
}
